import Layout from '../components/Layout'
import Form from '../components/Form'
import sendRequest from '../services/sendRequest'

const Index = () => (
    <Layout>
        <div>
            <Form/>
            <sendRequest/>
        </div>
    </Layout>
);
export default Index;
